import './App.css';
import Navbar from "./layout/Navbar";
import 'bootstrap/dist/css/bootstrap.min.css';
import Home from "./pages/Home";
import {BrowserRouter, Route} from "react-router-dom";

function App() {
  return (
    <div className="App">
        <Navbar/>
        <BrowserRouter>
            <Route path="/" element={<Home/>}/>
        </BrowserRouter>
    </div>
  );
}

export default App;
